import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import App from './App';
import Wrapper from './components/wrapper';
import Summary from './components/summary';

ReactDOM.render(
  <React.StrictMode>
    <Wrapper>
      <App />
      <Summary />
    </Wrapper>
  </React.StrictMode>,
  document.getElementById('root')
);
